@-moz-document domain('startpage.com') {

/* Start of custom CSS

ALTERNATIVE USER STYLE CSS FOR "STARTPAGE.COM":
------------------------------------------------------
This is the according user style CSS for "Startpage.com"
It makes Startpage a visual Google-Alt-Clone. There is also
an alternative Logo Image included. Startpage.com is
getting its search results by Google, but doesnt collect
any userdata. So its an anonymous version of Google.
This user css style gives it also a cleaner look. Its
very good for average computer users who are used to the
Google Interface.
------------------------------------------------------
------------------------------------------------------ 
Here you also find an alternative fav-icon:
https://imgur.com/a/GaIPVgq
------------------------------------------------------
------------------- HOW TO USE -----------------------
------------------------------------------------------
Use "Stylus"-Firefox Addon to integrate this CSS: Simply
copy all this text into a new Stylus, including this
comment. And please stop Google's world domination :-)
----------------------------------------------------- */



/* Home Page "Logo" (see also data at the bottom of css)
------------------------------------------------------ */
.hero-search__logo {
    opacity: 0 !important;
}

.hero-search__logo-link {
    width: 200px !important;
    height: 60px !important;
    background-size: cover;
}




/* Home Page Section "More Content"
------------------------------------------------------ */
.hero-search__learn-more,
#more-content {
    display: none !important;
}

/* Home Page Section "Footer"
------------------------------------------------------ */
footer > section {
    display: none !important;
}

.home-footer {
    margin-top: 0 !important;
}

.home-footer__bottom {
    padding: 0 !important;
}


.home-footer__logo img {
    opacity: 0 !important;
}

.home-footer__logo {
    filter: none !important;
    background-size: 50% !important;
    background-repeat: no-repeat !important;
    background-position: center center !important;
}




/* Search Results
------------------------------------------------------ */
.header__logo img {
    opacity: 0 !important;
}

.header__logo {
    filter: none !important;
    background-size: 50% !important;
    background-repeat: no-repeat !important;
    background-position: center center !important;
}

.promotion.card.search-item,
.instant-map__disclaimer {
    display: none !important;
}

.pagination {
    margin-top: 30px !important;
    margin-bottom: 30px !important;
}

.related-searches {
    margin-top: 50px !important;
}

.related-searches__title {
    margin-bottom: 0px !important;
}

.related-searches__list {
    font-size: .75rem !important;
}




/* Logo (included as Base-64 inline data stream)
------------------------------------------------------ */
.hero-search__logo-link,
.header__logo,
.home-footer__logo {
    background-image:
         url('data:image/png;base64,')
    !important;
}

  /* End of custom CSS */
}
